import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Perform a search to trigger the sort controls
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');

    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Wait for search results to load
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Apply price sort filter (low to high)
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for results to re-sort
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sorted.png'));

    // Extract product prices to verify sorting
    const prices = await page.$$eval('.product-price', elements => 
      elements.map(el => {
        const priceText = el.textContent.match(/\$(\d+\.\d{2})/);
        return priceText ? parseFloat(priceText[1]) : 0;
      })
    );

    // Verify prices are sorted in ascending order
    const isSorted = prices.every((price, i, arr) => 
      i === 0 || price >= arr[i - 1]
    );

    return {
      success: true,
      action: "Applied price sort filter (low to high) and verified sorting",
      extractedData: {
        prices: prices,
        isSorted: isSorted
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
